import axios from '@/assets/js/music-axios';
import fetchToken from '@/assets/js/fetchRecaptchaToken';
export default {
  data() {
    return {
      isLoading: false,
      title: '',
      description: '',
      link: '',
      isSent: false
    };
  },
  methods: {
    onSubmit() {
      if (this.isLoading) return;
      this.isLoading = true;
      fetchToken().then(token => {
        return axios.post('/songs', {
          title: this.title,
          link: this.link,
          description: this.description,
          creator: this.$store.state.yourName,
          day: this.$route.query.nr,
          token
        });
      }).then(res => {
        const song = res.data;
        this.$emit('songAdded', song);
        this.isSent = true;
      }).finally(() => {
        this.isLoading = false;
        this.title = '';
        this.link = '';
        this.description = '';
      });
    }
  }
};
